import React from 'react';

export default function LoginPage() {
  return (
    <div>
      <h1>이메일과 비밀번호를 입력해주세요</h1>
      <form>
        <label htmlFor="input_id">
          이메일 주소:
          <input
            type="checkbox"
            checked={this.state.isGoing}
            onChange={this.handleInputChange}
          />
        </label>
        <br />
        <label>
          Number of guests:
          <input
            name="numberOfGuests"
            type="number"
            value={this.state.numberOfGuests}
            onChange={this.handleInputChange}
          />
        </label>
      </form>
    </div>
  );
}
